import React from 'react';
import { Wind, Flame, Thermometer, Droplets } from 'lucide-react';

const SensorCard = ({ sensorData }) => {
  const getStatusColor = (value, threshold) => {
    if (value > threshold) return 'text-red-500';
    if (value > threshold * 0.7) return 'text-yellow-500';
    return 'text-green-500';
  };

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
      {/* MQ-2 Gas Sensor */}
      <div className="bg-gray-800/50 backdrop-blur-sm rounded-xl p-6 border border-gray-700 hover:border-blue-500 transition-all">
        <div className="flex items-center justify-between mb-4">
          <Wind className={getStatusColor(sensorData.gasLevel, 600)} size={32} />
          <span className="text-sm text-gray-400">MQ-2</span>
        </div>
        <h3 className="text-lg text-gray-400 mb-2">Gas Level</h3>
        <p className={`text-3xl font-bold ${getStatusColor(sensorData.gasLevel, 600)}`}>
          {sensorData.gasLevel} <span className="text-lg">ppm</span>
        </p>
        <div className="mt-3 h-2 bg-gray-700 rounded-full overflow-hidden">
          <div 
            className={`h-full transition-all ${sensorData.gasLevel > 600 ? 'bg-red-500' : 'bg-green-500'}`}
            style={{width: `${Math.min((sensorData.gasLevel / 1000) * 100, 100)}%`}}
          />
        </div>
      </div>

      {/* Flame Sensor */}
      <div className="bg-gray-800/50 backdrop-blur-sm rounded-xl p-6 border border-gray-700 hover:border-red-500 transition-all">
        <div className="flex items-center justify-between mb-4">
          <Flame className={sensorData.flameDetected ? 'text-red-500 animate-pulse' : 'text-gray-500'} size={32} />
          <span className="text-sm text-gray-400">Flame</span>
        </div>
        <h3 className="text-lg text-gray-400 mb-2">Fire Detection</h3>
        <p className={`text-3xl font-bold ${sensorData.flameDetected ? 'text-red-500' : 'text-green-500'}`}>
          {sensorData.flameDetected ? 'DETECTED' : 'SAFE'}
        </p>
        <p className="text-sm text-gray-500 mt-2">
          {sensorData.flameDetected ? '⚠️ Api terdeteksi!' : '✓ Tidak ada api'}
        </p>
      </div>

      {/* DHT22 Temperature */}
      <div className="bg-gray-800/50 backdrop-blur-sm rounded-xl p-6 border border-gray-700 hover:border-orange-500 transition-all">
        <div className="flex items-center justify-between mb-4">
          <Thermometer className={getStatusColor(sensorData.temperature, 32)} size={32} />
          <span className="text-sm text-gray-400">DHT22</span>
        </div>
        <h3 className="text-lg text-gray-400 mb-2">Temperature</h3>
        <p className={`text-3xl font-bold ${getStatusColor(sensorData.temperature, 32)}`}>
          {sensorData.temperature.toFixed(1)}°C
        </p>
        <p className="text-sm text-gray-500 mt-2">
          {sensorData.temperature > 32 ? '⚠️ Suhu tinggi' : '✓ Normal'}
        </p>
      </div>

      {/* DHT22 Humidity */}
      <div className="bg-gray-800/50 backdrop-blur-sm rounded-xl p-6 border border-gray-700 hover:border-cyan-500 transition-all">
        <div className="flex items-center justify-between mb-4">
          <Droplets className="text-cyan-500" size={32} />
          <span className="text-sm text-gray-400">DHT22</span>
        </div>
        <h3 className="text-lg text-gray-400 mb-2">Humidity</h3>
        <p className="text-3xl font-bold text-cyan-500">
          {sensorData.humidity.toFixed(1)}%
        </p>
        <p className="text-sm text-gray-500 mt-2">✓ Normal range</p>
      </div>
    </div>
  );
};

export default SensorCard;
